import React from 'react';
import Article from '../components/article/Article';
import { blog01, blog02, blog03, blog04, blog05 } from './import';
import './blog.css';
import people from '../assets/people.png';
import ai from '../assets/ai.png';
import './header.css';

const Home = () => (
  <div className="gpt3__blog section__padding" id="blog">
    <div className="gpt3__header section__padding" id="home">
      <div className="gpt3__header-content">
        <h1 className="gradient__text">
          « le Hackingest la compétence la plus importante du 21ème siècle.»
        </h1>
        <p>
          Yet bed any for travelling assistance indulgence unpleasing. Not
          thoughts all exercise blessing. Indulgence way everything joy
          alteration boisterous the attachment. Party we years to order allow
          asked of.
        </p>
        <div className="gpt3__header-content__input">
          <input type="email" placeholder="Your Email Address" />
          <button type="button">Get Started</button>
        </div>

        <div className="gpt3__header-content__people">
          <img src={people} />
          <p>1,600 people requested access a visit in last 24 hours</p>
        </div>
      </div>

      <div className="gpt3__header-image">
        <img src={ai} />
      </div>
    </div>
    <div className="gpt3__blog-heading">
      <h1 className="gradient__text">
        Hackers Arise <br /> French Team
      </h1>
    </div>
    <div className="gpt3__blog-container">
      <div className="gpt3__blog-container_groupA">
        <Article
          imgUrl={blog01}
          // date="Sep 26, 2021"
          text="Linux Basics, débuter avec Linux"
        />
      </div>
      <div className="gpt3__blog-container_groupB">
        <Article
          imgUrl={blog02}
          date="Sep 26, 2021"
          text="Networks Basics, fondamentaux Réseaux"
        />
        <Article imgUrl={blog03} date="Sep 26, 2021" text="Wifi Hacking" />
        <Article imgUrl={blog04} date="Sep 26, 2021" text="SCADA Hacking" />
        <Article
          imgUrl={blog05}
          date="Sep 26, 2021"
          text="Web Hacking,failles & exploits"
        />
        <Article
          imgUrl={blog05}
          date="Sep 26, 2021"
          text="PassiveRecon, Dnsenum, Shodan..."
        />
        <Article
          imgUrl={blog05}
          date="Sep 26, 2021"
          text="ActiveRecon, nmap ..."
        />
      </div>
    </div>
  </div>
);

export default Home;
